import React from "react";
import logoImage from './logo.png';


const customStyle = {
    background: "yellow",
    margin: "auto -16px",
    padding: "16px 32px",
    boxshadow: "0 0 10px rgba(0, 0, 0, 0,3" 
  }
  

function Header (){
    return (
        <header>
            <h1 style={customStyle}>Aptitude Test</h1>
            <img src={logoImage} alt="Company Logo" className="me-3" width="100" height="100" />
        </header>


    )
}

export default Header;
